    false,nt"url": null,nt"notes": "The imagery posted on this site is of the
    Florida panhandle and surrounding regions after Hurricane Ivan made landfall. The
    regions photographed range from Gulf Port, Mississippi, to Fort Walton Beach, Florida.
    The aerial photograph missions were conducted by the NOAA Remote Sensing Division
    the day after Ivan made landfall, September 17 and concluded September 20. The images
    were acquired from an altitude of 7,500 feet, using an Emerge/Applanix Digital Sensor
    System (DSS). A total of 2,000 aerial images were obtained during this time period,
    with more than 1,300 images available to view online and download.",nt"license_title":
